import './App.css';
import Header from './component/header/header'
import HomeTitle from './component/title/home/home_title'
import PopularCars from './component/popular_cars/popular_cars'
import Footer from './component/footer/footer'
import CarsTitle from './component/title/cars/cars_title'
import {useState} from 'react';


function App() {
  const [isHome, setIsHome] = useState(false);

  const homeHandler = () => {
    setIsHome(true);
  }
  const carsHandler = () => {
    setIsHome(false);
  }

  return (
    <div>
      <Header homeHandler={homeHandler} carsHandler={carsHandler}/>

      {isHome && <HomeTitle/>}
      {isHome && <PopularCars/>}

      <CarsTitle/>


      <Footer/>
    </div>
  );
}

export default App;
